/* Procedure structure for procedure `product_manage` */

/*!50003 DROP PROCEDURE IF EXISTS  `product_manage` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `product_manage`(
	p_id INT,
	p_code VARCHAR(10),
	p_name VARCHAR(50),
	p_quantity INT,
	p_price FLOAT,
	p_image BLOB,
	p_description TEXT
    )
BEGIN
		declare msg varchar(15);
		IF p_id = -1 THEN
			INSERT INTO products (p_code, p_name, quantity, price, image, p_description) VALUES (p_code, p_name, p_quantity, p_price, p_image, p_description);
			SET msg = "Added!";
			SELECT msg as messages;
		ELSE
			UPDATE products SET  p_code = p_code, p_name = p_name, quantity = p_quantity, price = p_price, image = p_image, p_description = p_description WHERE id = p_id;
			SET msg = "Updated!";
			SELECT msg AS messages;
		END IF;
	END */$$
DELIMITER ;

